import React from 'react';

const ImageWork = ({ src }) => {
    return (
        <div className={"row"}>
            <div className="col-12 text-center">
                <img
                    src={src}
                    className="landing-metinvest-vacancies-image"
                    alt={"Metinvest, Вакансії Діджитал Метінвест"}
                />
            </div>
        </div>
    );
};

const ImageWorkMobile = ({ src }) => {
    return (
        <div className={"row"}>
            <div className="col-12 text-center">
            <img
                src={src}
                className="landing-metinvest-vacancies-image-mobile"
                alt={"Metinvest, Вакансії Діджитал Metinvest"}
            />
            </div>
        </div>
    );
};

export {
    ImageWork as default,
    ImageWorkMobile
};
